import React from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";

function Menu(prop){
    if (prop.name==='Juan'){
        return (<div>Hola Juan</div>)
    } else {
        return (
            <BrowserRouter>
                <nav>
                    <ul>
                        <Link to="/"><button>Registrar</button></Link>
                        <Link to="/Loggin">Ingresar</Link>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/" component=""/>
                    <Route path="/Loggin" component=""/>
                </Switch>
            </BrowserRouter>    
        )
    }
}

export default Menu;
